xception Locked=\"false\" Priority=\"37\" Name=\"Bibliography\" ></w:LsdException>\r\n<w:LsdException Locked=\"false\" Priority=\"39\" QFormat=\"true\" Name=\"TOC Heading\" ></w:LsdException>\r\n</w:LatentStyles>\r\n</xml><![endif]-->  <!--[if gte mso 10]>\r\n<style>\r\n/* Style Definitions */\r\ntable.MsoNormalTable\r\n{mso-style-name:\"Table Normal\";\r\nmso-tstyle-rowband-size:0;\r\nmso-tstyle-colband-size:0;\r\nmso-style-noshow:yes;\r\nmso-style-priority:99;\r\nmso-style-parent:\"\";\r\nmso-padding-alt:0in 5.4pt 0in 5.4pt;\r\nmso-para-margin:0in;\r\nmso-para-margin-bottom:.0001pt;\r\nmso-pagination:widow-orphan;\r\nfont-size:10.0pt;\r\nfont-family:\"Times New Roman\";}\r\n</style>\r\n<![endif]-->    <!--StartFragment-->\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-GB\" style=\"font-family:Tahoma\">Cookies are files sent by web servers to web browsers, and stored by the web browsers. <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-GB\" style=\"font-family:Tahoma\">The information is then sent back to the server each time the browser requests a page from the server.  This enables a web server to identify and track web browsers. <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-GB\" style=\"font-family:Tahoma\">There are two main kinds of cookies: session cookies and persistent cookies.  Session cookies are deleted from your computer when you close your browser, whereas persistent cookies remain stored on your computer until deleted, or until they reach their expiry date.<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><b><span lang=\"EN-GB\" style=\"font-family:Tahoma\">Cookies on our website<o:p></o:p></span></b></p>\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-GB\" style=\"font-family:Tahoma\">Seemytag uses the following cookies on this website, for the following purposes:<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-GB\" style=\"font-family:Tahoma\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left:.5in;text-align:justify;text-indent:-.25in;\r\nmso-list:l0 level1 lfo1;tab-stops:list .5in left 6.0in\"><!--[if !supportLists]--><span lang=\"EN-GB\" style=\"font-size:9.0pt;font-family:Wingdings;mso-fareast-font-family:\r\nWingdings;mso-bidi-font-family:Wingdings\">l<span style=\"font-size: 7pt; font-family: \'Times New Roman\'; \">  </span></span><!--[endif]--><span lang=\"EN-GB\" style=\"font-family:Tahoma\">Signup<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left:.5in;text-align:justify;text-indent:-.25in;\r\nmso-list:l0 level1 lfo1;tab-stops:list .5in left 6.0in\"><!--[if !supportLists]--><span lang=\"EN-GB\" style=\"font-size:9.0pt;font-family:Wingdings;mso-fareast-font-family:\r\nWingdings;mso-bidi-font-family:Wingdings\">l<span style=\"font-size: 7pt; font-family: \'Times New Roman\'; \">  </span></span><!--[endif]--><span lang=\"EN-GB\" style=\"font-family:Tahoma\">Publicity<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left:.5in;text-align:justify;text-indent:-.25in;\r\nmso-list:l0 level1 lfo1;tab-stops:list .5in left 6.0in\"><!--[if !supportLists]--><span lang=\"EN-GB\" style=\"font-size:9.0pt;font-family:Wingdings;mso-fareast-font-family:\r\nWingdings;mso-bidi-font-family:Wingdings\">l<span style=\"font-size: 7pt; font-family: \'Times New Roman\'; \">  </span></span><!--[endif]--><span lang=\"EN-GB\" style=\"font-family:Tahoma\">Last location login<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"> </p>\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><b><span lang=\"EN-GB\" style=\"font-family:Tahoma\">Google cookies<o:p></o:p></span></b></p>\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-GB\" style=\"font-family:Tahoma\">Seemytag uses Google Analytics to analyse the use of this website.  Google Analytics generates statistical and other information about website use by means of cookies, which are stored on users\' computers.  The information generated relating to our website is used to create reports about the use of the website. Google will store and use this information.  Google\'s privacy policy is available at: http://www.google.com/privacypolicy.html.]<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-GB\" style=\"font-family:Tahoma\">Seemytag publishes our own interest-based advertisements on this website.  Our advertisements are tailored by us and our users to reflect your interests.  To determine your interests, Seemytag uses our own advertising system based on the users likes, wants and needs track your behaviour across the web using cookies. <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><b><span lang=\"EN-GB\" style=\"font-family:Tahoma\">Refusing cookies<o:p></o:p></span></b></p>\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-GB\" style=\"font-family:Tahoma\">Most browsers allow you to refuse to accept cookies.  <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-GB\" style=\"font-family:Tahoma\">In Internet Explorer, you can refuse all cookies by clicking “Tools”, “Internet Options”, “Privacy”, and selecting “Block all cookies” using the sliding selector.  <o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-GB\" style=\"font-family:Tahoma\">In Firefox, you can adjust your cookies settings by clicking “Tools”, “Options” and “Privacy”.<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-GB\" style=\"font-family:Tahoma\">Blocking cookies will have a negative impact upon the usability of some websites.<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-GB\" style=\"font-family:Tahoma\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><b><span lang=\"EN-GB\" style=\"font-family:Tahoma\">Credit<o:p></o:p></span></b></p>\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-GB\" style=\"font-family:Tahoma\">This document was created using a Contractology template available at <a href=\"http://www.freenetlaw.com/\">http://www.freenetlaw.com</a>.<o:p></o:p></span></p>','','2013-03-22 09:56:48'),
